import classes from './Settings.module.css';

const Settings = () => {
  return (
    <div className={classes.settingsTab}>
      <h1>APPLICATION SETTINGS</h1>
      <h2>Temperature unit</h2>
      <div className={classes.radioButtons}>
        <input type='radio' id='celsius' name='temperature' value='celsius' />
            <label for='celsius'>Celsius °C</label>
            <input type='radio' id='fahrenheit' name='temperature' value='fahrenheit' />
            <label for='celsius'>Fahrenheit °F</label>
      </div>
    </div>
  );
};

export default Settings;
